import React, {Component} from 'react';
import ScrollAnimation from 'react-animate-on-scroll';
import './App.css';


function App() {
  return (
    <Title/>
  );
}


class Title extends Component {
  render() {
    console.log(window.innerHeight/5);
    return (
      <ScrollAnimation animateIn="fadeIn" animateOut="fadeOut" className="Title" offset={window.innerHeight/5}>
        MAGDALEN BALL
      </ScrollAnimation>
    );
  }
}


export default App;
